import React, { useState } from "react";
import Footer from "../components/Footer";

function BookingPage() {
  const [formValues, setFormValues] = useState({
    name: "",
    email: "",
    month: "",
    day: "",
    year: "",
    hour: "",
    minute: "",
    ampm: "AM",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({
      ...formValues,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert("Form Submitted", formValues);
  };

  const generateOptions = (start, end, pad = false) => {
    const options = [];
    for (let i = start; i <= end; i++) {
      const value = pad && i < 10 ? "0" + i : i.toString();
      options.push(
        <option key={value} value={value}>
          {value}
        </option>,
      );
    }
    return options;
  };

  const currentYear = new Date().getFullYear();

  return (
    <>
      <div className="bookingpage__hero">
        <img className="logo" src="./images/logo.svg" alt="brand logo" />
        <div className="hero-content">
          <h1>Reservations</h1>
          <p>
            We can’t wait to host you. If you have any special requirements
            please feel free to call on the phone number below. We’ll be happy
            to accommodate you.
          </p>
          <button className="mobile">reserve place</button>
        </div>
      </div>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          id="name"
          name="name"
          value={formValues.name}
          onChange={handleChange}
          placeholder="Name"
          required
        />
        <input type="email" placeholder="Email" />
        <div className="date">
          <label>Pick a date</label>
          <select>
            <option>MM</option>
          </select>
          <select>
            <option>DD</option>
          </select>
          <select>
            <option>YYYY</option>
          </select>
        </div>
        <div className="time">
          <label>Pick a time</label>
          <select>
            <option>09</option>
          </select>
          <select>
            <option>00</option>
          </select>
          <select>
            <option>AM</option>
            <option>PM</option>
          </select>
        </div>
      </form>
      <Footer />
    </>
  );
}

export default BookingPage;
